import React from "react";
import { Flex, Image, Box } from "@chakra-ui/react";
import logo from "../assets/logo.png";

const NavBar = () => {
    return(
        <>
        <Flex as='nav' bg='tomato' gap="10" justifyContent="space-between" position="fixed">
            <Box w="10%">
                <Image src={logo} alt="solo mina corp" boxSize='100px'></Image>
            </Box>
            
        </Flex>
        </>
    )
};

export default NavBar;
